#
# Complete the 'compareStrings' function below.
#
# The function is expected to return an INTEGER.
# The function accepts following parameters:
#  1. STRING s1
#  2. STRING s2
#

def compareStrings(s1, s2):
    def convert(s):
        l = list(s)
        counter = 0
        while len(l)>counter:
            if l[counter] == "#":
                if counter>0:
                    del l[counter-1]
                    del l[counter-1]
                    counter-=1
                else:
                    del l[counter]
            else:
                counter+=1
        return l
    if convert(s1)==convert(s2):
        return 1
    else:
        return 0

